webpackJsonp([67585602699531],{621:function(e,s){e.exports={pathContext:{docHtml:'<h1>AWS SQS</h1>\n<p>AWS SNS gateway consumes messages from SQS queue.</p>\n<h3>How to define an event source in confimap?</h3>\n<p>An entry in configmap corresponds to <a href="https://github.com/argoproj/argo-events/blob/a913dafbf000eb05401ef2c847b29152af82977f/gateways/community/aws-sqs/config.go#L37-L51">this</a>.</p>\n<p>Because SQS works on polling, you need to provide a <code>waitTimeSeconds</code>.</p>\n<h2>Setup</h2>\n<p><strong>1. Install <a href="../../examples/gateways/aws-sqs.yaml">Gateway</a></strong></p>\n<p>Make sure gateway pod and service is running</p>\n<p><strong>2. Install <a href="../../examples/event-sources/aws-sqs.yaml">Event Source</a></strong></p>\n<p><strong>3. Install <a href="../../examples/sensors/aws-sqs.yaml">Sensor</a></strong></p>\n<p>Make sure sensor pod is created.</p>\n<p><strong>4. Trigger Workflow</strong></p>\n<p>As soon as there a message is consumed from SQS queue, a workflow will be triggered.</p>',docPath:"argo-events/docs/gateways/aws-sqs",proj:"argo-events"}}}});
